import React from 'react';
import SwipeableTextMobileStepper from './path/to/SwipeableTextMobileStepper'; // Remplacez 'path/to' par le chemin réel vers le fichier SwipeableTextMobileStepper.jsx
import { PRODUCTS } from '../../products';
import { Product } from './product';
import './shop.css';
export const Shop = () => {
  return (

    <div className='shop'>
      <SwipeableTextMobileStepper />
        <div className='shopTitle'>
            <h1>Welcome Page</h1>
        </div>
        <div className='products'>
            {PRODUCTS.map((product) => (
            <Product data={product}/>
            ))}
        </div>
    </div>
  )
}
